DROP TABLE IF EXISTS `course_secondary_major_classification`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `course_secondary_major_classification` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `course_code` bigint NOT NULL,
  `track_type` varchar(32) COLLATE utf8mb4_unicode_ci NOT NULL,
  `completion_type` varchar(32) COLLATE utf8mb4_unicode_ci NOT NULL,
  `department_id` bigint NOT NULL,
  `raw_classification` varchar(64) COLLATE utf8mb4_unicode_ci NOT NULL,
  `raw_department_token` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_csmc_course_track_completion_department` (`course_code`,`track_type`,`completion_type`,`department_id`),
  KEY `fk_csmc_department` (`department_id`),
  KEY `idx_csmc_lookup` (`track_type`,`completion_type`,`department_id`,`course_code`),
  KEY `idx_csmc_course_code` (`course_code`),
  CONSTRAINT `fk_csmc_course_code` FOREIGN KEY (`course_code`) REFERENCES `course` (`code`),
  CONSTRAINT `fk_csmc_department` FOREIGN KEY (`department_id`) REFERENCES `department` (`id`),
  CONSTRAINT `chk_csmc_completion_type` CHECK ((`completion_type` in (_utf8mb4'REQUIRED',_utf8mb4'ELECTIVE',_utf8mb4'RECOGNIZED'))),
  CONSTRAINT `chk_csmc_track_type` CHECK ((`track_type` in (_utf8mb4'DOUBLE_MAJOR',_utf8mb4'MINOR',_utf8mb4'CROSS_MAJOR')))
) ENGINE=InnoDB AUTO_INCREMENT=7004 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
